import React from "react";
import "./PrimaryButtonWithIcon.css";

function PrimaryButtonWithIcon({ icon, children, onClick, className }) {
  const btnClass = searchActive
    ? "primary-btn-with-icon-transparent"
    : "primary-btn-with-icon";
  return (
    <button className={btnClass} onClick={onClick}>
      <img src={icon} alt="" />
      <span>{children}</span>
    </button>
  );
}

export default PrimaryButtonWithIcon;
